import React from "react";
import "../page/style/RightBox.css";

function RightBox() {
  return (
    <div className="RightBox">
      <div className="best-box">
        <div className="best-box-name">최근 게시물</div>
        <div className="best-content-box">
          <div className="best-post-top">best post title1</div>
          <div className="best-post-middle">best post content 1</div>
          <div className="best-post-bottom">한국인의 top 10 콘텐츠</div>
        </div>
        <div className="best-content-box">
          <div>content-title2</div>
          <div>date</div>
        </div>
      </div>
    </div>
  );
}

export default RightBox;
